import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../styles/LocationCSS/LocationListPage.css';

function LocationListPage() {
  const [locations, setLocations] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [activeFilter, setActiveFilter] = useState('all');

  // Fetch data
  useEffect(() => {
    const fetchLocations = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/locations');
        if (!response.ok) throw new Error('Failed to fetch');
        const data = await response.json();
        setLocations(data);
        setLoading(false);
      } catch (err) {
        setError(err.message);
        setLoading(false);
      }
    };
    fetchLocations();
  }, []);

  const filterLocations = (category) => {
    setActiveFilter(category);
  };

  if (loading) return <div className="loader">Đang tải...</div>;
  if (error) return <div className="error-message">Lỗi: {error}</div>;

  return (
    <div className="locations-page">
      <div className="locations-hero">
        <h1>Khám Phá Phú Yên</h1>
        <p>Điểm đến tuyệt vời cho chuyến du lịch của bạn</p>
      </div>

      <div className="container">
        <div className="filters-section">
          <button 
            className={`filter-btn ${activeFilter === 'all' ? 'active' : ''}`}
            onClick={() => filterLocations('all')}
          >
            Tất cả
          </button>
          <button 
            className={`filter-btn ${activeFilter === 'beach' ? 'active' : ''}`}
            onClick={() => filterLocations('beach')}
          >
            <i className="bi bi-water"></i> Bãi biển
          </button>
          <button 
            className={`filter-btn ${activeFilter === 'mountain' ? 'active' : ''}`}
            onClick={() => filterLocations('mountain')}
          >
            <i className="bi bi-mountain"></i> Núi
          </button>
          <button 
            className={`filter-btn ${activeFilter === 'culture' ? 'active' : ''}`}
            onClick={() => filterLocations('culture')}
          >
            <i className="bi bi-bank"></i> Văn hóa
          </button>
        </div>

        <div className="locations-grid">
          {locations.map(location => (
            <Link to={`/locations/${location.id}`} key={location.id} className="location-card">
              <div className="location-image">
                <img src={location.introduction?.image ? 
                  `http://localhost:5000${location.introduction.image}` : 
                  'https://via.placeholder.com/400x300'} 
                  alt={location.title} 
                />
                <div className="location-category">
                  <i className="bi bi-geo-alt-fill"></i>
                  {location.category}
                </div>
              </div>
              <div className="location-info">
                <h3>{location.title}</h3>
                <p>{location.subtitle}</p>
                <div className="location-meta">
                  <span><i className="bi bi-star-fill"></i> 4.5</span>
                  <span><i className="bi bi-heart"></i> {location.likes || 0}</span>
                </div>
              </div>
            </Link>
          ))}
        </div>
      </div>
    </div>
  );
}

export default LocationListPage;
